import './App.css';

function App() {
  return (
    <div className="App">
      <h3>Muwatana</h3>
      <p>learn to navigate the digital world safely</p>
      <ul>
        <li>About</li>
        <li>Resources</li>
        <li>Digital Citizenship Principles</li>
        <li>Contact ISF</li>
      </ul>
    </div>
  );
}

export default App;
